def rules():
	#Relations:
	x = ['BPF', 'TF', 'BI', 'KV']
	y = ['malo','srednje','veliko']
	relations = []
	for xi in x:
		for yi in y:
			r_help = xi+' == '+yi
			relations.append(r_help)
	
	bpfr = relations[0:3]
	tfr = relations[3:6]
	bir = relations[6:9]
	kvr = relations[9:12]
	relations = []
	for i in bpfr:
		for j in tfr:
			for k in bir:
				for l in kvr:
					relation = 'if '+i+' and '+j+' and '+k+' and '+l
					relations.append(relation)
	
	#Prepositions:
	z = ['FV']
	prepositions = []
	for zi in z:
		for yi in y:
			prep_help = zi+' = '+yi
			prepositions.append(prep_help)

	#Rules:
	index1 = [1,4,5,7,10,13,16,28,29,31,34,37,40,46,55]
	index2 = [2,8,11,14,17,19,20,22,23,30,32,33,35,38,39,41,43,47,49,50,56,58,59,64,67,68,70,73]
	index3 = [3,6,9,12,15,18,21,24,25,26,27,36,42,44,45,48,51,52,53,54,57,60,61,62,63,65,66,69,71,72,74,75,76,77,78,79,80,81]

	rules1 = []
	rules2 = []
	rules3 = []

	for ind in index1:
		rule = relations[ind-1] + ' then ' +prepositions[0]
		rules1.append(rule)
		
	for ind in index2:
		rule = relations[ind-1] + ' then ' +prepositions[1]
		rules2.append(rule)
		
	for ind in index3:
		rule = relations[ind-1] + ' then ' +prepositions[2]
		rules3.append(rule)
			
			
	rules = rules1 + rules2 + rules3
	
	return rules
		

def malo(c):
	malo = {}
	x = range(0,c+1,1)
	y = []
	
	c = float(c)
	
	for i in x:
		y_i = (c-i)/c
		y_i = round(y_i,2)
		y.append(y_i)
		
	for i in x:
		malo[i] = y[x.index(i)]
	
	return malo

def srednje(a, b, c):
	srednje = {}
	x1 = range(a,b,1)
	x2 = range(b,c+1,1)
	y1 = []
	y2 = []
	
	a = float(a)
	b = float(b)
	c = float(c)
	
	for i in x1:
		y1_i = (i-a)/(b-a)
		y1_i = round(y1_i,2)
		y1.append(y1_i)
	
	for i in x2:
		y2_i = (c-i)/(c-b)
		y2_i = round(y2_i,2)
		y2.append(y2_i)
	
	x = x1 + x2
	y = y1 + y2
	for i in x:
		srednje[i] = y[x.index(i)]
	
	return srednje
	
